module.exports = {
  plugins: {
    tailwindcss: {},
    autoprefixer: {},
  },
}

/// <reference types="next" />
/// <reference types="next/image-types/global" />

// NOTE: This file should not be edited
// see https://nextjs.org/docs/app/building-your-application/configuring/typescript for more information.

interface FeatureCardProps {
  icon: ReactNode;
  title: string;
  description: string;
  gradient: string;
  borderColor: string;
}

function FeatureCard({ icon, title, description, gradient, borderColor }: FeatureCardProps) {
  return (
    <div className="group relative p-8 rounded-2xl bg-white/3 border border-white/5 hover:border-white/10 transition-all duration-500 hover:bg-white/5 hover:shadow-xl hover:shadow-black/20">
      <div className={`w-12 h-12 rounded-xl ${gradient} flex items-center justify-center mb-6 group-hover:scale-110 transition-transform duration-300`}>
        {icon}
      </div>
      <h3 className="text-xl font-semibold text-white mb-3 group-hover:text-cyan-300 transition-colors">
        {title}
      </h3>
      <p className="text-gray-400 leading-relaxed group-hover:text-gray-300 transition-colors">
        {description}
      </p>
      <div className={`absolute inset-0 rounded-2xl opacity-0 group-hover:opacity-100 transition-opacity duration-500 bg-gradient-to-br ${borderColor} blur-xl -z-10`} />
    </div>
  );
}

function Home() {
  return (
    <main className="min-h-screen bg-black text-white selection:bg-white/20">
      <Navbar />
      <Hero />
      <Stats />
      <Features />
      <Pricing />
      <CTA />
      <Footer />
    </main>
  );
}

export { default as Navbar } from './Navbar';
export { default as Hero } from './Hero';
export { default as Features } from './Features';
export { default as Stats } from './Stats';
export { default as Pricing } from './Pricing';
export { default as CTA } from './CTA';
export { default as Footer } from './Footer';
export { default as CodeEditor } from './CodeEditor';

import type { Config } from "tailwindcss"

const config: Config = {
  content: [
    "./src/pages/**/*.{js,ts,jsx,tsx,mdx}",
    "./src/components/**/*.{js,ts,jsx,tsx,mdx}",
    "./src/app/**/*.{js,ts,jsx,tsx,mdx}",
  ],
  theme: {
    extend: {
      colors: {
        background: "var(--background)",
        foreground: "var(--foreground)",
        // VS Code Dark Theme Colors
        'vs-bg': '#1e1e1e',
        'vs-bg-hover': '#2a2d2e',
        'vs-bg-active': '#37373d',
        'vs-border': '#3c3c3c',
        'vs-titlebar': '#252526',
        'vs-activitybar': '#333333',
        'vs-sidebar': '#252526',
        'vs-editor-bg': '#1e1e1e',
        'vs-editor-gutter': '#2d2d2d',
        'vs-editor-line-highlight': '#2a2d2e',
        'vs-editor-selection': '#264f78',
        'vs-editor-inactive-selection': '#3a3d41',
        'vs-statusbar': '#007acc',
        'vs-statusbar-hover': '#005a9e',
        'vs-tab-active': '#1e1e1e',
        'vs-tab-inactive': '#2d2d2d',
        'vs-tab-hover': '#2a2d2e',

        // Syntax Highlighting Colors
        'syntax-keyword': '#c586c0',
        'syntax-function': '#dcdcaa',
        'syntax-string': '#ce9178',
        'syntax-comment': '#6a9955',
        'syntax-number': '#b5cea8',
        'syntax-variable': '#9cdcfe',
        'syntax-type': '#4ec9b0',
        'syntax-property': '#9cdcfe',
        'syntax-operator': '#d4d4d4',
        'syntax-punctuation': '#d4d4d4',
        'syntax-tag': '#569cd6',
        'syntax-attribute': '#9cdcfe',
        'syntax-annotation': '#bb86fc',
      },
      animation: {
        'gradient-x': 'gradient-x 15s ease infinite',
        'float': 'float 6s ease-in-out infinite',
        'pulse-slow': 'pulse 4s cubic-bezier(0.4, 0, 0.6, 1) infinite',
        'blink': 'blink 1s step-end infinite',
        'fade-in': 'fadeIn 0.2s ease-out',
      },
      keyframes: {
        'gradient-x': {
          '0%, 100%': {
            'background-size': '200% 200%',
            'background-position': 'left center'
          },
          '50%': {
            'background-size': '200% 200%',
            'background-position': 'right center'
          },
        },
        'float': {
          '0%, 100%': {
            transform: 'translateY(0px)'
          },
          '50%': {
            transform: 'translateY(-20px)'
          },
        },
        'blink': {
          '0%, 50%': { opacity: '1' },
          '51%, 100%': { opacity: '0' },
        },
        'fadeIn': {
          '0%': { opacity: '0', transform: 'translateY(-4px)' },
          '100%': { opacity: '1', transform: 'translateY(0)' },
        },
      },
      fontFamily: {
        'mono': ['"Fira Code"', '"Cascadia Code"', '"Consolas"', '"Courier New"', 'monospace'],
      },
    },
  },
  plugins: [],
}
export default config

function RootLayout({
  children,
}: Readonly<{
  children: React.ReactNode;
}>) {
  return (
    <html lang="en" className="scroll-smooth">
      <body className="antialiased bg-black text-white selection:bg-white/20">
        {children}
      </body>
    </html>
  );
}

/** @type {import('next').NextConfig} */
const nextConfig = {
  compress: true,
  swcMinify: true,
  poweredByHeader: false,
  reactStrictMode: true,
  images: {
    formats: ['image/avif', 'image/webp'],
    minimumCacheTTL: 31536000,
  },
  headers: async () => {
    return [
      {
        source: '/:path*',
        headers: [
          {
            key: 'X-DNS-Prefetch-Control',
            value: 'on',
          },
          {
            key: 'X-Content-Type-Options',
            value: 'nosniff',
          },
          {
            key: 'X-Frame-Options',
            value: 'SAMEORIGIN',
          },
          {
            key: 'X-XSS-Protection',
            value: '1; mode=block',
          },
        ],
      },
    ];
  },
};

module.exports = nextConfig;

interface Feature {
  icon: React.ReactNode;
  title: string;
  description: string;
  gradient: string;
  color: string;
}

function Features() {
  const [activeFeature, setActiveFeature] = useState(0);

  const features: Feature[] = [
    {
      icon: (
        <svg className="w-7 h-7" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="1.5">
          <path d="M9.663 17h4.673M12 3v1m6.364 1.636l-.707.707M21 12h-1M4 12H3m3.343-5.657l-.707-.707m2.828 9.9a5 5 0 117.072 0l-.548.547A3.374 3.374 0 0014 18.469V19a2 2 0 11-4 0v-.531c0-.895-.356-1.754-.988-2.386l-.548-.547z" />
        </svg>
      ),
      title: '极致视觉体验',
      description: '多主题支持：Adnify Dark、Midnight、Cyberpunk、Dawn。玻璃拟态设计，沉浸式布局。',
      gradient: 'from-purple-500/30 to-pink-500/30',
      color: 'text-purple-400',
    },
    {
      icon: (
        <svg className="w-7 h-7" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="1.5">
          <path d="M9 12l2 2 4-4m5.618-4.016A11.955 11.955 0 0112 2.944a11.955 11.955 0 01-8.618 3.04A12.02 12.02 0 003 9c0 5.591 3.824 10.29 9 11.622 5.176-1.332 9-6.03 9-11.622 0-1.042-.133-2.052-.382-3.016z" />
        </svg>
      ),
      title: 'AI Agent 深度集成',
      description: '三种工作模式：Chat / Agent / Plan。23 个内置工具，支持 OpenAI、Claude、Gemini、DeepSeek 等。',
      gradient: 'from-blue-500/30 to-cyan-500/30',
      color: 'text-blue-400',
    },
    {
      icon: (
        <svg className="w-7 h-7" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="1.5">
          <path d="M17 20h5v-2a3 3 0 00-5.356-1.857M17 20H7m10 0v-2c0-.656-.126-1.283-.356-1.857M7 20H2v-2a3 3 0 015.356-1.857M7 20v-2c0-.656.126-1.283.356-1.857m0 0a5.002 5.002 0 019.288 0M15 7a3 3 0 11-6 0 3 3 0 016 0zm6 3a2 2 0 11-4 0 2 2 0 014 0zM7 10a2 2 0 11-4 0 2 2 0 014 0z" />
        </svg>
      ),
      title: '智能上下文',
      description: '@文件名、@codebase、@git、@terminal、@symbols 引用，上下文理解更精准。',
      gradient: 'from-cyan-500/30 to-teal-500/30',
      color: 'text-cyan-400',
    },
    {
      icon: (
        <svg className="w-7 h-7" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="1.5">
          <path d="M13 10V3L4 14h7v7l9-11h-7z" />
        </svg>
      ),
      title: 'MCP 协议支持',
      description: '集成 Model Context Protocol，支持外部工具扩展，MCP 富文本渲染。',
      gradient: 'from-pink-500/30 to-rose-500/30',
      color: 'text-pink-400',
    },
    {
      icon: (
        <svg className="w-7 h-7" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="1.5">
          <path d="M4 7v10c0 2.21 3.582 4 8 4s8-1.79 8-4V7M4 7c0 2.21 3.582 4 8 4s8-1.79 8-4M4 7c0-2.21 3.582-4 8-4s8 1.79 8 4m0 5c0 2.21-3.582 4-8 4s-8-1.79-8-4" />
        </svg>
      ),
      title: '专业开发体验',
      description: 'Monaco Editor + xterm.js 终端 + typescript-language-server，支持 Git、向量存储。',
      gradient: 'from-amber-500/30 to-orange-500/30',
      color: 'text-amber-400',
    },
    {
      icon: (
        <svg className="w-7 h-7" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="1.5">
          <path d="M9 3v2m6-2v2M9 19v2m6-2v2M5 9H3m2 6H3m18-6h-2m2 6h-2M7 19h10a2 2 0 002-2V7a2 2 0 00-2-2H7a2 2 0 00-2 2v10a2 2 0 002 2zM9 9h6v6H9V9z" />
        </svg>
      ),
      title: '跨平台支持',
      description: 'Electron + React + TypeScript + Vite 构建，支持 Windows、macOS、Linux。',
      gradient: 'from-emerald-500/30 to-green-500/30',
      color: 'text-emerald-400',
    },
  ];

  return (
    <section id="features" className="py-32 px-6 relative">
      {/* Background gradient */}
      <div className="absolute inset-0 bg-gradient-to-b from-black via-blue-950/10 to-black pointer-events-none" />

      <div className="max-w-7xl mx-auto relative">
        {/* Section header */}
        <div className="text-center mb-20">
          <span className="text-sm font-medium text-gray-500 mb-4 block animate-fade-in">核心特性</span>
          <h2 className="text-4xl md:text-5xl font-semibold text-white mb-6 tracking-tight animate-fade-in-up">
            为开发者而生的
            <br />
            <span className="text-gray-400">下一代代码编辑器</span>
          </h2>
          <p className="text-xl text-gray-400 max-w-2xl mx-auto animate-fade-in-up" style={{ animationDelay: '0.1s' }}>
            融合 Cyberpunk 玻璃拟态设计，内置强大 AI Agent，支持全流程自动化开发。
          </p>
        </div>

        {/* Feature cards */}
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-6">
          {features.map((feature, index) => (
            <div 
              key={index}
              className="group relative p-8 rounded-3xl bg-white/3 border border-white/5 hover:bg-white/5 hover:border-white/10 transition-all duration-500 animate-fade-in-up"
              style={{ animationDelay: `${0.1 + index * 0.05}s` }}
            >
              {/* Gradient glow on hover */}
              <div className={`absolute inset-0 rounded-3xl bg-gradient-to-br ${feature.gradient} opacity-0 group-hover:opacity-100 transition-opacity duration-500 blur-xl`} />

              <div className="relative">
                {/* Icon */}
                <div className={`w-14 h-14 rounded-2xl bg-gradient-to-br ${feature.gradient} flex items-center justify-center mb-6 group-hover:scale-110 group-hover:rotate-3 transition-all duration-500`}>
                  <div className={feature.color}>{feature.icon}</div>
                </div>

                {/* Content */}
                <h3 className="text-xl font-semibold text-white mb-3 group-hover:text-blue-200 transition-colors">
                  {feature.title}
                </h3>
                <p className="text-gray-400 leading-relaxed group-hover:text-gray-300 transition-colors">
                  {feature.description}
                </p>
              </div>

              {/* Arrow indicator */}
              <div className="absolute bottom-8 right-8 w-10 h-10 rounded-full bg-white/5 flex items-center justify-center opacity-0 group-hover:opacity-100 group-hover:translate-x-0 translate-x-2 transition-all duration-300">
                <svg className="w-5 h-5 text-white" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                  <path d="M5 12h14M12 5l7 7-7 7" />
                </svg>
              </div>
            </div>
          ))}
        </div>

        {/* Interactive demo section */}
        <div className="mt-32 relative">
          <InteractiveDemo />
        </div>
      </div>
    </section>
  );
}

function InteractiveDemo() {
  const [demoStep, setDemoStep] = useState(0);

  const demoSteps = [
    { label: 'Start typing', description: 'AI suggests completions in real-time' },
    { label: 'Ask AI', description: 'Get explanations and code generation' },
    { label: 'Refactor', description: 'Smart refactoring with one click' },
  ];

  return (
    <div className="rounded-3xl overflow-hidden border border-white/10 bg-black/50 backdrop-blur-xl">
      <div className="flex items-center justify-between px-6 py-4 border-b border-white/5">
        <div className="flex items-center gap-4">
          <div className="flex gap-2">
            <div className="w-3 h-3 rounded-full bg-red-500/80" />
            <div className="w-3 h-3 rounded-full bg-yellow-500/80" />
            <div className="w-3 h-3 rounded-full bg-green-500/80" />
          </div>
          <span className="text-sm text-gray-500">demo.adnify.dev</span>
        </div>
        <div className="flex gap-2">
          {demoSteps.map((_, index) => (
            <button
              key={index}
              onClick={() => setDemoStep(index)}
              className={`w-3 h-3 rounded-full transition-all cursor-pointer ${
                demoStep === index 
                  ? 'bg-white scale-125' 
                  : 'bg-white/20 hover:bg-white/40'
              }`}
            />
          ))}
        </div>
      </div>

      <div className="p-8">
        <div className="flex items-center gap-4 mb-6">
          <div className="flex-1 h-px bg-white/10" />
          <span className="text-sm text-gray-500">{demoSteps[demoStep].label}</span>
          <div className="flex-1 h-px bg-white/10" />
        </div>
        <p className="text-center text-gray-400">{demoSteps[demoStep].description}</p>
      </div>
    </div>
  );
}

function Pricing() {
  const [billingPeriod, setBillingPeriod] = useState<'monthly' | 'yearly'>('monthly');

  const plans = [
    {
      name: 'Personal',
      price: billingPeriod === 'monthly' ? 'Free' : 'Free',
      period: '',
      description: 'For indie developers and students',
      features: [
        'AI autocomplete',
        '5 private repos',
        'Community support',
        'Standard themes',
        'Basic analytics',
      ],
      cta: 'Get Started',
      highlighted: false,
    },
    {
      name: 'Pro',
      price: billingPeriod === 'monthly' ? '$12' : '$10',
      period: billingPeriod === 'monthly' ? '/month' : '/month',
      description: 'For professional developers',
      features: [
        'Everything in Personal',
        'Unlimited private repos',
        'Priority support',
        'Custom themes',
        'API access',
        'Advanced analytics',
        'Custom keybindings',
      ],
      cta: 'Start Free Trial',
      highlighted: true,
    },
    {
      name: 'Team',
      price: billingPeriod === 'monthly' ? '$39' : '$32',
      period: billingPeriod === 'monthly' ? '/seat/month' : '/seat/month',
      description: 'For teams and startups',
      features: [
        'Everything in Pro',
        'Team workspaces',
        'SSO & SAML',
        'Audit logs',
        'Dedicated support',
        'Custom onboarding',
        'SLA guarantee',
      ],
      cta: 'Contact Sales',
      highlighted: false,
    },
  ];

  return (
    <section id="pricing" className="py-32 px-6 relative">
      {/* Background gradient */}
      <div className="absolute inset-0 bg-gradient-to-b from-black via-purple-950/10 to-black pointer-events-none" />

      <div className="max-w-7xl mx-auto relative">
        {/* Section header */}
        <div className="text-center mb-20">
          <span className="text-sm font-medium text-gray-500 mb-4 block animate-fade-in">Pricing</span>
          <h2 className="text-4xl md:text-5xl font-semibold text-white mb-6 tracking-tight animate-fade-in-up">
            Simple, transparent pricing.
          </h2>
          <p className="text-xl text-gray-400 max-w-2xl mx-auto mb-10 animate-fade-in-up" style={{ animationDelay: '0.1s' }}>
            Choose the plan that's right for you. All plans include a 14-day free trial.
          </p>

          {/* Billing toggle */}
          <div className="inline-flex items-center gap-4 p-1 rounded-full bg-white/5 border border-white/10 animate-fade-in-up" style={{ animationDelay: '0.15s' }}>
            <button
              onClick={() => setBillingPeriod('monthly')}
              className={`px-6 py-2 rounded-full text-sm font-medium transition-all cursor-pointer ${
                billingPeriod === 'monthly'
                  ? 'bg-white text-black'
                  : 'text-gray-400 hover:text-white'
              }`}
            >
              Monthly
            </button>
            <button
              onClick={() => setBillingPeriod('yearly')}
              className={`px-6 py-2 rounded-full text-sm font-medium transition-all cursor-pointer flex items-center gap-2 ${
                billingPeriod === 'yearly'
                  ? 'bg-white text-black'
                  : 'text-gray-400 hover:text-white'
              }`}
            >
              Yearly
              <span className="px-2 py-0.5 text-xs bg-green-500/20 text-green-400 rounded-full">-17%</span>
            </button>
          </div>
        </div>

        {/* Pricing cards */}
        <div className="grid md:grid-cols-3 gap-6 max-w-5xl mx-auto">
          {plans.map((plan, index) => (
            <div
              key={index}
              className={`relative p-8 rounded-3xl transition-all duration-500 animate-fade-in-up ${
                plan.highlighted
                  ? 'bg-white/10 border-2 border-white/20 hover:bg-white/15'
                  : 'bg-white/3 border border-white/5 hover:bg-white/5 hover:border-white/10'
              }`}
              style={{ animationDelay: `${0.2 + index * 0.1}s` }}
            >
              {/* Featured badge */}
              {plan.highlighted && (
                <div className="absolute -top-4 left-1/2 -translate-x-1/2 px-4 py-1 bg-gradient-to-r from-blue-500 to-purple-500 rounded-full text-sm font-medium text-white shadow-lg">
                  推荐
                </div>
              )}

              <div className="mb-6">
                <h3 className="text-xl font-semibold text-white mb-2">{plan.name}</h3>
                <p className="text-gray-400 text-sm">{plan.description}</p>
              </div>

              <div className="mb-6">
                <span className="text-5xl font-semibold text-white">{plan.price}</span>
                {plan.period && <span className="text-gray-400 ml-1">{plan.period}</span>}
              </div>

              <ul className="space-y-4 mb-8">
                {plan.features.map((feature, featureIndex) => (
                  <li key={featureIndex} className="flex items-center gap-3">
                    <div className="w-5 h-5 rounded-full bg-white/10 flex items-center justify-center flex-shrink-0">
                      <Check className="w-3 h-3 text-white" />
                    </div>
                    <span className="text-gray-300 text-sm">{feature}</span>
                  </li>
                ))}
              </ul>

              <button
                className={`w-full py-3.5 rounded-full font-medium transition-all cursor-pointer ${
                  plan.highlighted
                    ? 'bg-white text-black hover:bg-gray-100'
                    : 'bg-white/10 text-white hover:bg-white/20'
                }`}
              >
                {plan.cta}
              </button>
            </div>
          ))}
        </div>

        {/* FAQ section */}
        <div className="mt-32">
          <h3 className="text-2xl font-semibold text-white text-center mb-12">Frequently asked questions</h3>
          <div className="grid md:grid-cols-2 gap-6 max-w-4xl mx-auto">
            {[
              { q: 'Can I try Adnify for free?', a: 'Yes! The Personal plan is completely free for individuals and students.' },
              { q: 'Is my code secure?', a: 'Absolutely. We use bank-grade encryption and are SOC 2 compliant.' },
              { q: 'Can I switch plans later?', a: 'Yes, you can upgrade or downgrade at any time.' },
              { q: 'Do you offer team discounts?', a: 'Yes, contact our sales team for enterprise and team pricing.' },
            ].map((faq, index) => (
              <div key={index} className="p-6 rounded-2xl bg-white/3 border border-white/5">
                <h4 className="text-lg font-medium text-white mb-2">{faq.q}</h4>
                <p className="text-gray-400 text-sm">{faq.a}</p>
              </div>
            ))}
          </div>
        </div>
      </div>
    </section>
  );
}

function GradientText({ children }: { children: React.ReactNode }) {
  return (
    <span className="bg-gradient-to-r from-blue-400 via-purple-400 to-pink-400 bg-clip-text text-transparent animate-gradient-x bg-[length:200%_200%]">
      {children}
    </span>
  );
}

function Navbar() {
  const [scrolled, setScrolled] = useState(false);
  const [menuOpen, setMenuOpen] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 50);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const navItems = [
    { name: 'Features', href: '#features' },
    { name: 'Changelog', href: 'https://github.com/adnaan-worker/adnify/releases' },
    { name: 'Documentation', href: 'https://github.com/adnaan-worker/adnify' },
    { name: 'Blog', href: 'https://github.com/adnaan-worker/adnify' },
    { name: 'Contact', href: 'mailto:adnaan.worker@gmail.com' },
  ];

  return (
    <nav 
      className={`fixed top-0 left-0 right-0 z-50 transition-all duration-700 ${
        scrolled 
          ? 'bg-black/80 backdrop-blur-2xl border-b border-white/10 py-4' 
          : 'bg-transparent py-6'
      }`}
    >
      <div className="max-w-7xl mx-auto px-6 flex items-center justify-between">
        {/* Logo */}
        <Link href="/" className="flex items-center gap-3 group">
