        <span className="ml-3 text-xs text-gray-500">main.ts</span>
      </div>

      {/* Code content */}
      <div className="p-4 overflow-x-auto">
        <pre className="text-gray-300">
          <code dangerouslySetInnerHTML={{
            __html: code
              .replace(/&/g, '&amp;')
              .replace(/</g, '&lt;')
